import React from "react";
import { Header } from "../components/Header";
import SearchBar from "../components/mini/SearchBar";
import '../components/CSS/HomePage.css';

export const Home = () => {
    return (
        <>
        <div className="back">
            <Header></Header>
            <SearchBar />
        </div>
        <Container maxWidth="sm"></Container>

        </>
    )
}
